-- Table structure for c_company
-- ----------------------------
DROP TABLE IF EXISTS `c_company`;
CREATE TABLE `c_company` (
  `company_id` varchar(10) NOT NULL COMMENT '公司流水号',
  `company_code` varchar(50) NOT NULL COMMENT '公司编码',
  `company_name` varchar(50) DEFAULT NULL COMMENT '公司名称',
  `company_country_code` char(2) DEFAULT NULL COMMENT '公司地址国家',
  `company_state` varchar(500) DEFAULT NULL COMMENT '公司地址省州',
  `company_address` varchar(500) DEFAULT NULL COMMENT '公司详细地址',
  `user_token` text COMMENT '第三方token',
  `developer_token` text COMMENT '开发者token',
  `last_recharge_time` datetime DEFAULT NULL,
  `company_amount` double(12,3) DEFAULT NULL COMMENT '公司账户余额(美元)',
  `product_lable_length` int(11) DEFAULT NULL COMMENT '商品条码长度(mm)',
  `product_lable_height` int(11) DEFAULT NULL COMMENT '商品条码高度(mm)',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `create_by` varchar(10) DEFAULT NULL COMMENT '创建人',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `update_by` varchar(10) DEFAULT NULL COMMENT '更新人',
  `freeze_status` char(1) DEFAULT NULL COMMENT '0或null代表未冻结；1代表已冻结',
  `product_sku_scannable` char(1) DEFAULT NULL COMMENT '是否允许扫描产品SKU（1：允许  其他:不允许）',
  `allow_self_replace_flag` char(1) DEFAULT NULL COMMENT '自助换单（1：允许  其他:不允许）',
  `fee_discount_tg` double(8,2) DEFAULT NULL COMMENT '托管处理费折扣',
  `fee_discount_zx` double(8,2) DEFAULT NULL COMMENT '专线处理费折扣',
  `freight_discount` double(8,2) DEFAULT NULL COMMENT '运费折扣',
  `transport_sender_name` varchar(100) DEFAULT NULL COMMENT '头程发件人姓名',
  `transport_sender_address` varchar(500) DEFAULT NULL COMMENT '头程发件人地址',
  `transport_sender_address1` varchar(255) DEFAULT NULL COMMENT '头程发件人地址1',
  `transport_sender_address2` varchar(255) DEFAULT NULL COMMENT '头程发件人地址2',
  `transport_sender_city` varchar(100) DEFAULT NULL COMMENT '头程发件人城市',
  `transport_sender_state` varchar(100) DEFAULT NULL COMMENT '头程发件人省州',
  `transport_sender_country_code` char(2) DEFAULT NULL COMMENT '头程发件人国家代码',
  `transport_sender_post_code` varchar(20) DEFAULT NULL COMMENT '头程发件人邮编',
  `transport_sender_mobile` varchar(100) DEFAULT NULL COMMENT '头程发件人手机',
  `transport_sender_phone` varchar(100) DEFAULT NULL COMMENT '头程发件人联系电话',
  `allow_prediction_pack_flag` char(1) DEFAULT NULL COMMENT '使用预报重量为实称重量(0/null：不允许； 1：允许)',
  `system_out_deliver_flag` varchar(1) DEFAULT NULL COMMENT '是否系统外发货(0/null:不允许;1:允许;2:允许过/曾经允许)',
  `website_logo_kh` varchar(255) DEFAULT NULL COMMENT '客户端网站logo',
  `website_name_kh` varchar(200) DEFAULT NULL COMMENT '客户端网站名',
  `footer_script_kh` text COMMENT '客户端页脚代码',
  `website_logo_yw` varchar(255) DEFAULT NULL COMMENT '运维端网站logo',
  `website_name_yw` varchar(200) DEFAULT NULL COMMENT '运维端网站名',
  `footer_script_yw` text COMMENT '运维端页脚代码',
  `website_logo` varchar(255) DEFAULT NULL COMMENT '客户端网站logo',
  `website_name` varchar(200) DEFAULT NULL COMMENT '客户端网站名',
  `client_url` varchar(255) DEFAULT NULL COMMENT '客户端URL(只需指定代理商)',
  `bussiness_url` varchar(255) DEFAULT NULL COMMENT '运维端URL(只需指定代理商)',
  `company_type` char(1) DEFAULT '0' COMMENT '公司类型（0:自发客户;1:代理商;2:代理商客户）',
  `belong_agent_company_id` varchar(10) DEFAULT NULL COMMENT '归属代理商公司流水号（代理商开发客户存在）',
  `deal_freight` double(8,2) DEFAULT '0.30' COMMENT '处理费（每单）',
  `deal_freight_currency` varchar(3) DEFAULT 'USD' COMMENT '处理费币种',
  `allow_owe_consign_flag` varchar(1) DEFAULT NULL COMMENT '是否允许欠费可以继续交运(0/null：不允许； 1：允许)',
  PRIMARY KEY (`company_id`),
  UNIQUE KEY `company_code_UK` (`company_code`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='公司信息';

